const notes = [
	{ key: 1, title: "Note 1", body: "This is note 1" },
	{ key: 2, title: "Note 2", body: "This is note 2" },
	{ key: 3, title: "Note 3", body: "This is note 3" },
	{ key: 4, title: "Note 4", body: "This is note 4" },
];
export default notes;
